LANGUAGE plpgsql
AS $$
BEGIN
PERFORM net.http_post(
url:=current_setting('app.supabase_url') || '/functions/v1/expire-task-boosts',
headers:=jsonb_build_object('Content-Type', 'application/json'),
body:='{"edge_function_name":"expire-task-boosts"}',
